import styled from "styled-components/native";
import { colors } from "../../../infrastructure/theme/colors";
import { Button } from "react-native-paper";
import { Constants } from "../../../../constants/db.mock";

export const LogisticsContainer = styled.View`
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: ${Constants.theme.dark};
  flex: 1;
`;

export const LogisticsPrimary = styled.Text`
  margin-top: 30px;
  color: #fff;
  text-align: center;
  font-size: 20px;
  font-weight: bold;
`;

export const LogisticsWrapper = styled.View`
  display: flex;
  flex-flow: row;
`;

export const LogisticsRow = styled.View`
  display: flex;
  flex-flow: column;
  justify-content: center;
  padding: 25px;
  align-items: center;
`;

export const AddressBtn = styled(Button).attrs({ color: colors.ui.primary })`
  width: 128px;
  height: 64px;
  background: ${Constants.theme.primary};
  font-size: 12px;
  padding: 12px;
  left: 30px;
  top: 20px;
  font-weight: 200;
  border-radius: 15px;
`;

export const AddressCover = styled(Button).attrs({
  color: colors.ui.quaternary,
})`
  width: 128px;
  height: 64px;
  background: #4e4e4e;
  font-size: 12px;
  top: 20px;
  font-weight: 200;
  padding: 12px;
  border-radius: 15px;
`;

